import { gql } from "apollo-server-micro";

const typeDefs = gql`
  type YoutubeLink {
    title: String!
    id: String!
    date: String!
  }

  type Query {
    youtubeLinks: [YoutubeLink!]!,
    hello: String!
  }
`;

export default typeDefs;
